import React, { useState } from "react";
import  Api  from "./api";



const Interview = () => {
    const [val , setVal] = useState(Api)
    return (
        <>
            {
                Api.map((e)=>{
                    const [id , Q] = e;
                    return
                    <h1>{e.Q}</h1>
                })
            }
        </>
    )
}

export default Interview;
